import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import Login from './pages/Login';

function App() {
  return (
    <Router>
      <Route>
        <Login/>
      </Route>
      <Headers />
    </Router>
  );
}

export default App;
